      text: 'Hi @tunajoe:7uVPJS9GHoftN58Z2MXCYDqmNAh2,\n\nYou should first rins your quinoa, then I always like to toast the seeds (for extra flavour) before I bring the liquids to a boil.\n\nWhen you have that rolling boil, you add the quinoa and lower the heat to low. Cook for about 15 minuts under lid, until the liquid is gone and then remove the pot from the heat. Leave covered for an additional 5 minutes to let the quinoa settle.\n\nFluff the quinoa with a fork before serving.\n\n2:1 liquids:quinoa\nFor extra flavour you can use a broth/stock instead of water.\n\n\nI hope this was helpful :)',
