      text: "* Turn the grill on, make it hot as hell\n* Clean the gridiron when heated\n* Gently place your (marinated/seasoned) fish on the grill, skin side down\n* Don't touch it until it let go of the gridiron\n* When you can move the fillet without it breaking into peaces you can gently flip it and let it cook for a couple of minutes\n* Enjoy the fish!\n\nIt's important that you do not try to move the fillet around when it's on the first (skin) side. The pores will close as the liquids evaporate and it will form a crust. When the crust is formed it will automatically let go of the grill and you can move it without breaking your beautiful fillet.\n",
