      publishedAt: 1597204228,
      text: 'The second generation, XA20 series RAV4 went on sale in July 2000. Like the previous model, the XA20 was available in three- and five-door configurations and was constructed on a platform that shared Carina and Corolla elements. Development began in 1995, with a design freeze in the first half of 1998. Styling was done at Calty Design Research Incorporated (also simply known as Calty) by Yasuhide Hosoda and Kevin Hunter from 1996 to 1997.',
