      text: "The BMW 3 Series is an entry-level luxury car manufactured by the German automaker BMW since May 1975. It is the successor to the 02 Series and has been produced in six different generations.\n\nThe first generation of the 3 Series was only available as a 2-door sedan, however the model range has since expanded to include a 4-door sedan, 2-door convertible, 2-door coup√©, 5-door station wagon and 5-door hatchback body styles. Since 2013, the coup√© and convertible models have been marketed as the 4 Series, therefore the 3 Series range no longer includes these body styles.\n\nThe 3 Series is BMW's best-selling model, accounting for around 30% of the BMW brand's annual total sales (excluding motorbikes).[1] The BMW 3 Series has won numerous awards throughout its history.\n\nhttps://en.wikipedia.org/wiki/BMW_3_Series",
